const container = document.getElementById('container');
const width = container.scrollWidth;
const height = (container.scrollHeight || 500) * 2; // Double the canvas height

const attribute = 'type'; // Replace with the actual attribute name

// Calculate the average number of connections for nodes with the same attribute
const attributeConnections = {};
data.nodes.forEach((node) => {
  const attributeValue = String(node[attribute]);
  if (!attributeConnections[attributeValue]) {
    attributeConnections[attributeValue] = {
      count: 0,
      total: 0,
    };
  }
  const connectedEdges = data.edges.filter(
    (edge) => String(edge.source) === String(node.id) || String(edge.target) === String(node.id)
  );
  attributeConnections[attributeValue].count++;
  attributeConnections[attributeValue].total += connectedEdges.length;
});

// Create filteredData object
const filteredData = {
  nodes: [],
  edges: [],
};

function filterAndPopulateData(selectedNodeType) {
  const filteredNodes = data.nodes
    .filter((node) => String(node.type) === String(selectedNodeType))
    .map((node) => {
      const connectedEdges = data.edges.filter(
        (edge) => String(edge.source) === String(node.id) || String(edge.target) === String(node.id)
      );
      const attributeValue = node[attribute];
      const averageConnections =
        attributeConnections[attributeValue].total /
        attributeConnections[attributeValue].count;
        let redValue;

        if (connectedEdges.length > averageConnections * 5) {
          redValue = 0;
        } else {
          redValue = Math.abs((averageConnections - connectedEdges.length%averageConnections) / averageConnections * 255);
        }        
      return {
        ...node,
        style: {
          fill: `rgb(${redValue}, 0, 0)`,
        },
        depth: connectedEdges.length,
      };
    });

  filteredNodes.sort((a, b) => b.depth - a.depth); // Sort nodes by total connections in descending order
  const topNodes = filteredNodes.slice(0, 100); // Keep only the top 100 nodes

  filteredData.nodes = topNodes;

  filteredData.edges = data.edges.filter((edge) => {
    const { source, target } = edge;
    const sourceNode = topNodes.find((node) => node.id === source);
    const targetNode = topNodes.find((node) => node.id === target);
    return (
      sourceNode &&
      targetNode &&
      String(sourceNode.type) === String(selectedNodeType) &&
      String(targetNode.type) === String(selectedNodeType)
    );
  });
}

// Initialize the graph
const graph = new G6.Graph({
  container: 'container',
  width,
  height,
  modes: {
    default: ['drag-canvas', 'drag-node'],
  },
  layout: {
    type: 'circular',
  },
  animate: true,
  defaultNode: {
    size: 20,
    style: {
      fill: 'red',
    },
    labelCfg: {
      style: {
        fill: '#000',
      },
    },
  },
  defaultEdge: {
    style: {
      stroke: '#666',
      lineWidth: 1,
    },
  },
  edgeStyle: (edge) => ({
    stroke: edgeColors[edge.getModel().type],
  }),
});

// Render the graph with the initial data
filterAndPopulateData('unknown');
graph.data(filteredData);
graph.render();

// Event listener for the node type selection
const nodeTypeSelect = document.getElementById('nodeTypeSelect');
nodeTypeSelect.addEventListener('change', (event) => {
  const selectedNodeType = event.target.value;
  filterAndPopulateData(selectedNodeType);
  graph.data(filteredData);
  graph.render();
});

// Resize the graph when the window is resized
if (typeof window !== 'undefined') {
  window.onresize = () => {
    if (!container || !container.scrollWidth || !container.scrollHeight) {
      return;
    }

    graph.changeSize(container.scrollWidth, container.scrollHeight);
  };
}
